import React from 'react'
import "./Dashboard.css"
import GlobalStyle from './GlobalStyles';


//routing
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import TableauDeBord from './dashbord.screens/screens/TableauDeBord';
import EnVerification from './dashbord.screens/screens/EnVerification';

import MainDash from '../../components/Dashboard.components/MainDash/MainDash'
import Sidebar from '../../components/Dashboard.components/Sidebar/Sidebar.jsx'

const Dashboard = () => {
  return (
    <>
      <div className="DashboardContainer">
      <div className="DashboardGlass">
        <Sidebar/>
        <MainDash>
          <Router>
            <GlobalStyle/>
            <Switch>
              <Route exact path ='/tableau-de-bord'  component={TableauDeBord}/>
              <Route       path ='/en-verification'  component={EnVerification}/>
            </Switch>
          </Router> 
        </MainDash>  
      </div>
    </div>
    </>
  )
}

export default Dashboard
